# Recieves the name of the desired label and the board where it
# is contained. Returns the label object.
def get_label(name, board):
    label_list = board.get_labels()
    for label in label_list:
        if name in label.name: return label


def check(source_list, tpa_name):
    it_review = 0
    qa_fail = 0
    xpath_error = 0
    in_progress = 0
    
    for card_name in source_list:
        status = automation.get_source_status(card_name)
        
        if "QA-Fail" in status:
            qa_fail += 1
        elif "IT-Review" in status:
            it_review += 1
        elif "xPath Error" in status:
            xpath_error += 1
        elif "In-Progress" in status:
            in_progress += 1
    
    fails = it_review + qa_fail + xpath_error

    if (fails == 0):
        tpa_status = "Verde"
    elif (fails <= 3):
        tpa_status = "Verde claro"
    else:
        tpa_status = "Azul"
    
    # print("*Agency: " + tpa_name + " - " + tpa_status + "*" + "\n" + "  IT-Review: "+ str(it_review) + "\n" + "  QA-Fail: " + str(qa_fail) + "\n" + "  xPath Error:" + str(xpath_error) + "\n\n")
    log_txt.write("*Agency: " + tpa_name + " - " + tpa_status + "*" + "\n" + "  IT-Review: "+ str(it_review) + "\n" + "  QA-Fail: " + str(qa_fail) + "\n" + "  xPath Error:" + str(xpath_error) + "\n" + "  In-Progress:" + str(in_progress) + "\n\n")





